import React from "react"

function Gallery(props) {
    return (
        <div>
            {props.wallet.map((e, id) => 
                <ListOfProjects
                    photo={e.photo}
                    text={e.text}
                    key={id}
                />
            )}
        </div>
    )
}

export default Gallery
